import { useState, useEffect } from 'react';


export default function Fetch() {
  const [quiz, setQuiz] = useState([]);

  useEffect(()=>{
    fetch("http://localhost:3001/getQuizList",{method: "get"}).then(
      (res) => {
                return res.json();}).then(
                                    (data) => {
                                    console.log(data);
                                    setQuiz(data) });
  },[])

  return(  
    <>
    <p>{quiz.map((singolo)=>{
      return (<>
      {singolo.id}<br></br>
      </>)
    })}</p>
    </>
  )
}


